import React from "react";
import ImportHistoryTable from "../components/ImportHistoryTable";

const ImportHistory = () => {
  return (
    <div className="container mt-4">
      <h2>Import History</h2>
      <ImportHistoryTable />
    </div>
  );
};

export default ImportHistory;
